//import logo from './logo.svg';
//import './App.css';
import Header from "../src/components/Header.js";
import Footer from "../src/components/Footer.js";
import Carrito from "../src/components/Carrito.js";
import Contacto from "../src/components/Contacto.js";
import SobreMi from "../src/components/SobreMi.js";
import Tienda from "./components/tienda.js";
function App() {
  return (
  <>
    <div className="App">
    <Header/>  
    <Footer/>
    <Carrito/>
    <Contacto/>
    <SobreMi/>
    <Tienda/>
    </div>
  </>
  );
}

export default App;
